soup = BeautifulSoup(html, "html.parser")

# Pega todos os nomes das colunas do thead
thead = soup.find("thead")
nomes = [th.get_text(strip=True) for th in thead.find_all("th")]

# Pega a primeira linha do tbody (onde estão as odds)
tbody = soup.find("tbody")
primeira_linha = tbody.find("tr")
odds = [td.get_text(strip=True) for td in primeira_linha.find_all("td")]

# Monta o resultado no formato "nome" e "odd"
players = []
for nome, odd in zip(nomes, odds):
    players.append({
        "nome": nome,
        "odd": odd
    })

# Salva no arquivo pitaco.json
with open("pitaco.json", "w", encoding="utf-8") as f:
    json.dump(players, f, ensure_ascii=False, indent=4)

print("Arquivo pitaco.json criado com sucesso!")